def plot_and_save_line_chart(x_values, y_values_list, labels, save_path):
    # 创建一个新的Figure对象
    plt.figure()

    # 绘制折线图
    for y_values, label in zip(y_values_list, labels):
        plt.plot(x_values, y_values, label=label)

    # 添加图例
    plt.legend()

    # 添加标题和标签
    plt.title(" ")
    plt.xlabel("Epoch")
    plt.ylabel("mAP@0.5")

    # 保存图表为图片
    plt.savefig(save_path)

    # 显示图表（如果你想在运行代码的时候直接显示图表）
    plt.show()


